INSERT INTO public.ai_category_decisions (id, title_hash, title, description, category_id, confidence, reasoning, alternative_category_ids, ai_model, processing_time_ms, ai_domain, ai_product_type, ai_keywords, user_confirmed, user_corrected_category_id, user_feedback_at, created_at, updated_at, entity_type) VALUES (1, '4ab638604a52eacc612d63a2b6ede1583947bb6f54ac0742c2e54757730a5d27', 'Квартира 2-комнатная в центре Нового Сада', 'Продается 2-комнатная квартира 65м2 в центре Нового Сада. 3 этаж, лифт, балкон, центральное отопление.', 1401, 0.9900, '', '{}', 'local_algorithms', 0, NULL, NULL, NULL, false, NULL, NULL, '2025-09-22 16:36:06.518507', '2025-09-22 16:36:06.518507', 'listing');
INSERT INTO public.ai_category_decisions (id, title_hash, title, description, category_id, confidence, reasoning, alternative_category_ids, ai_model, processing_time_ms, ai_domain, ai_product_type, ai_keywords, user_confirmed, user_corrected_category_id, user_feedback_at, created_at, updated_at, entity_type) VALUES (3, 'ca825ab73b31b28a2d578f40a04dd30d77c333907fc7249a952f85f17e71804e', 'Керамическая ваза-осьминог ручной работы', 'Уникальная керамическая ваза в форме осьминога. Ручная работа, высота 30см. Идеально подходит для украшения интерьера. Цвет: морская волна с золотистыми акцентами.', 1501, 0.9000, 'Товар представляет собой керамическую вазу, которая предназначена для украшения интерьера, что делает ее подходящей для категории ''Мебель''.', NULL, 'claude-3-haiku-20240307', 1204, NULL, NULL, NULL, false, NULL, NULL, '2025-09-22 16:48:09.570382', '2025-09-22 16:48:09.570382', 'listing');
INSERT INTO public.ai_category_decisions (id, title_hash, title, description, category_id, confidence, reasoning, alternative_category_ids, ai_model, processing_time_ms, ai_domain, ai_product_type, ai_keywords, user_confirmed, user_corrected_category_id, user_feedback_at, created_at, updated_at, entity_type) VALUES (4, '17b4e98f543d13d019e2b88e7c269778fd9152d05aa8df199bea21aeb36180a2', 'iPhone 15 Pro Max 256GB', 'Новый iPhone 15 Pro Max, цвет титановый синий, 256GB памяти. В комплекте зарядка и чехол.', 1101, 0.9900, 'Товар описывает новую модель iPhone, который относится к категории смартфонов.', NULL, 'claude-3-haiku-20240307', 913, NULL, NULL, NULL, false, NULL, NULL, '2025-09-22 16:48:16.604734', '2025-09-22 16:48:16.604734', 'listing');
INSERT INTO public.ai_category_decisions (id, title_hash, title, description, category_id, confidence, reasoning, alternative_category_ids, ai_model, processing_time_ms, ai_domain, ai_product_type, ai_keywords, user_confirmed, user_corrected_category_id, user_feedback_at, created_at, updated_at, entity_type) VALUES (5, 'f50cd8c0cb5405125bf70b41a096cd0ece3605e8b904beab2f1af7c90881a406', 'Mercedes-Benz E220d 2019', 'Mercedes E220d, 2019 год, дизель 2.0, автомат, пробег 45000км. Полная комплектация, состояние отличное.', 1301, 0.9500, 'Данный товар представляет собой подержанный автомобиль Mercedes-Benz E220d 2019 года, что очевидно соответствует категории ''Lični automobili'' (Легковые автомобили).', NULL, 'claude-3-haiku-20240307', 1201, NULL, NULL, NULL, false, NULL, NULL, '2025-09-22 16:48:23.204445', '2025-09-22 16:48:23.204445', 'listing');
INSERT INTO public.ai_category_decisions (id, title_hash, title, description, category_id, confidence, reasoning, alternative_category_ids, ai_model, processing_time_ms, ai_domain, ai_product_type, ai_keywords, user_confirmed, user_corrected_category_id, user_feedback_at, created_at, updated_at, entity_type) VALUES (7, '9c9a0efb59e5807d2d83c752cc5d4e379678a893e9bdf16a7de48273ceb3e05c', 'Вечернее платье с пайетками', 'Красивое вечернее платье черного цвета с пайетками. Размер M (44-46). Длина миди, открытая спина.', 1202, 0.9500, 'Описание товара ясно указывает, что это вечернее платье, которое относится к категории женской одежды.', NULL, 'claude-3-haiku-20240307', 1115, NULL, NULL, NULL, false, NULL, NULL, '2025-09-22 16:48:45.399702', '2025-09-22 16:48:45.399702', 'listing');
INSERT INTO public.ai_category_decisions (id, title_hash, title, description, category_id, confidence, reasoning, alternative_category_ids, ai_model, processing_time_ms, ai_domain, ai_product_type, ai_keywords, user_confirmed, user_corrected_category_id, user_feedback_at, created_at, updated_at, entity_type) VALUES (9, 'a4a52d029af54e0e44b378e333312ec07ec793bde977c6dff8f46e2ca54c8df9', 'Серый диван с декоративными подушками', 'Удобный серый диван в хорошем состоянии. Комплектуется декоративными подушками зеленого и розового цветов. Обивка из велюра, мягкое сиденье с эффектом утяжки. На стене над диваном размещены картины. Отлично впишется в современный интерьер.', 1501, 0.9500, 'Товар является диваном, который относится к категории мебели, поэтому наиболее подходящей категорией является ''Nameštaj'' (Furniture).', NULL, 'claude-3-haiku-20240307', 1139, NULL, NULL, NULL, false, NULL, NULL, '2025-09-22 17:28:28.099319', '2025-09-22 17:28:28.099319', 'listing');
INSERT INTO public.ai_category_decisions (id, title_hash, title, description, category_id, confidence, reasoning, alternative_category_ids, ai_model, processing_time_ms, ai_domain, ai_product_type, ai_keywords, user_confirmed, user_corrected_category_id, user_feedback_at, created_at, updated_at, entity_type) VALUES (10, 'f21e5b0a7e58368bfc81c5652d318c834a9952345252537fed24cd2bf123727c', 'Кожаный диван синего цвета', 'Двухместный кожаный диван в синем цвете. Имеет потертости на подлокотниках. Мягкие сидения с секциями, комфортная спинка. Диван находится в использованном состоянии, но сохраняет функциональность. Обивка из натуральной кожи, прочная конструкция.', 1501, 0.9000, 'Товар описан как двухместный кожаный диван, который является предметом мебели. Категория ''Мебель'' является наиболее подходящей для данного товара.', NULL, 'claude-3-haiku-20240307', 1085, NULL, NULL, NULL, false, NULL, NULL, '2025-09-22 17:32:52.739973', '2025-09-22 17:32:52.739973', 'listing');
INSERT INTO public.ai_category_decisions (id, title_hash, title, description, category_id, confidence, reasoning, alternative_category_ids, ai_model, processing_time_ms, ai_domain, ai_product_type, ai_keywords, user_confirmed, user_corrected_category_id, user_feedback_at, created_at, updated_at, entity_type) VALUES (11, 'e566d787c27e2e23474e79e1a39d8456b6728eb81f644b467a166c33d420b3af', 'Xiaomi Mi 8 Telefon', 'Xiaomi Mi 8 mobilni telefon sa MIUI Global 12.0.3 verzijom. Uređaj ima 128GB ukupne memorije od koje je zauzeto 58,3GB. Android verzija je 10 (QKQ1.190828.002). Poslednje ažuriranje bezbednosti je od 01.09.2020. Telefon je u funkcionalnom stanju sa instaliranim MIUI interfejsom.', 1101, 0.9900, '', '{}', 'local_algorithms', 4, NULL, NULL, NULL, false, NULL, NULL, '2025-09-23 09:45:14.426826', '2025-09-23 09:45:14.426826', 'listing');
INSERT INTO public.ai_category_decisions (id, title_hash, title, description, category_id, confidence, reasoning, alternative_category_ids, ai_model, processing_time_ms, ai_domain, ai_product_type, ai_keywords, user_confirmed, user_corrected_category_id, user_feedback_at, created_at, updated_at, entity_type) VALUES (12, 'a017a21a82ac8004e50cd12f4ad8cacb15575ded378c89825d8316d4afb91fd7', 'МФУ Canon PIXMA G3420', 'Струйное многофункциональное устройство Canon PIXMA G3420 в отличном состоянии. Принтер оснащен системой непрерывной подачи чернил (СНПЧ), имеет функции печати, сканирования и копирования. Поддерживает беспроводное подключение через Wi-Fi. ЖК-дисплей для удобного управления. Экономичная печать благодаря заправляемым чернильницам.', 1106, 0.9000, 'Этот товар является многофункциональным устройством (МФУ), которое совмещает в себе функции принтера, сканера и копира, что соответствует категории ''Photo & Video''. Кроме того, устройство поддерживает беспроводное подключение через Wi-Fi, что также характерно для данной категории.', NULL, 'claude-3-haiku-20240307', 1476, NULL, NULL, NULL, false, NULL, NULL, '2025-09-23 10:04:26.914223', '2025-09-23 10:04:26.914223', 'listing');
INSERT INTO public.ai_category_decisions (id, title_hash, title, description, category_id, confidence, reasoning, alternative_category_ids, ai_model, processing_time_ms, ai_domain, ai_product_type, ai_keywords, user_confirmed, user_corrected_category_id, user_feedback_at, created_at, updated_at, entity_type) VALUES (13, 'fafba5e52f8215d62014c1b4cd14f45b9a4c05003ae930a3a41cdcf8aecb9e45', 'Skalpel za papir', 'Profesionalni skalpel za precizno sečenje papira i kartona. Metalno kućište sa gumiranom drškom za sigurno držanje. Poseduje mehanizam za zaključavanje sečiva i sistem za zamenu oštrice. Sečivo je izuzetno oštro i pogodno za precizne rezove.', 10232, 0.9500, 'Товар представляет собой профессиональный скальпель для резки бумаги и картона, что соответствует категории строительных инструментов. Описание указывает на точность и надежность инструмента, что подходит для данной категории.', NULL, 'claude-3-haiku-20240307', 1439, NULL, NULL, NULL, false, NULL, NULL, '2025-09-23 10:20:07.743761', '2025-09-23 10:20:07.743761', 'listing');
INSERT INTO public.ai_category_decisions (id, title_hash, title, description, category_id, confidence, reasoning, alternative_category_ids, ai_model, processing_time_ms, ai_domain, ai_product_type, ai_keywords, user_confirmed, user_corrected_category_id, user_feedback_at, created_at, updated_at, entity_type) VALUES (14, '98300846d5dadbaa57e8cb607c38cb787c4a0f700dd500eb5c24bbf85085755e', 'Modern Dining Chair', 'Modern dining chair featuring light grey upholstery and wooden legs. The chair appears to be in excellent condition with clean lines and contemporary design. Comfortable padding and durable fabric make it suitable for daily use. The chair has a high back design for added comfort.', 1501, 0.9500, 'Based on the description, this appears to be a modern dining chair designed for daily use in a home or dining setting. The key features like upholstery, wooden legs, and contemporary design indicate this belongs in the Furniture category.', NULL, 'claude-3-haiku-20240307', 1038, NULL, NULL, NULL, false, NULL, NULL, '2025-09-23 12:28:53.535246', '2025-09-23 12:28:53.535246', 'listing');
INSERT INTO public.ai_category_decisions (id, title_hash, title, description, category_id, confidence, reasoning, alternative_category_ids, ai_model, processing_time_ms, ai_domain, ai_product_type, ai_keywords, user_confirmed, user_corrected_category_id, user_feedback_at, created_at, updated_at, entity_type) VALUES (16, '7b3fbf1a19ab11a1ff4e30af001fdc68082912f49b86eca9c8d91c55aad2d39d', 'Upholstered Dining Chair', 'Modern upholstered dining chair in beige fabric with wooden legs. Features a high backrest and comfortable padded seat. The chair appears to be in excellent condition with clean upholstery and sturdy construction. Neutral color scheme that would complement most dining room decors.', 1501, 0.9000, 'Товар описывается как обитый тканью стул для столовой, который подходит для использования в интерьере. Это указывает на то, что он относится к категории мебели, а не к другим предметам, таким как книги, электроника или товары для активного отдыха.', NULL, 'claude-3-haiku-20240307', 1421, NULL, NULL, NULL, false, NULL, NULL, '2025-09-23 13:37:57.71801', '2025-09-23 13:37:57.71801', 'listing');
INSERT INTO public.ai_category_decisions (id, title_hash, title, description, category_id, confidence, reasoning, alternative_category_ids, ai_model, processing_time_ms, ai_domain, ai_product_type, ai_keywords, user_confirmed, user_corrected_category_id, user_feedback_at, created_at, updated_at, entity_type) VALUES (8, 'a5ac2f67b08f3c20c2aafdf681c04487d362fac332a52ac44fd0aa1aac086e24', 'Product for Sale', 'Please add a description for this product.', 1012, 0.8000, 'Товар имеет общее название ''Product for Sale'', без конкретной информации о типе товара. Поэтому наиболее подходящей категорией является ''Books & Stationery'', так как данная категория может включать в себя широкий спектр товаров для продажи.', NULL, 'claude-3-haiku-20240307', 1418, NULL, NULL, NULL, false, NULL, NULL, '2025-09-22 17:23:14.761886', '2025-09-25 09:00:13.986222', 'listing');
INSERT INTO public.ai_category_decisions (id, title_hash, title, description, category_id, confidence, reasoning, alternative_category_ids, ai_model, processing_time_ms, ai_domain, ai_product_type, ai_keywords, user_confirmed, user_corrected_category_id, user_feedback_at, created_at, updated_at, entity_type) VALUES (32, 'e2bae69277f6e2e52127a0bd4f62cca29e6591ce79d2a76b1b8edb17b299bc9a', 'Volkswagen Touran минивэн', 'Серый компактный минивэн Volkswagen Touran в хорошем состоянии. Надежный семейный автомобиль с просторным салоном, подходящий для городской езды и семейных поездок. Привезен из Европы, ухоженный, без видимых повреждений.', 1301, 0.9900, '', '{}', 'local_algorithms', 4, NULL, NULL, NULL, false, NULL, NULL, '2025-09-25 09:42:43.001639', '2025-09-25 09:42:43.001639', 'listing');
INSERT INTO public.ai_category_decisions (id, title_hash, title, description, category_id, confidence, reasoning, alternative_category_ids, ai_model, processing_time_ms, ai_domain, ai_product_type, ai_keywords, user_confirmed, user_corrected_category_id, user_feedback_at, created_at, updated_at, entity_type) VALUES (34, '344d3b74fea020b738968824f349420bef5b247c98ef13d88412cadf3cc6aec1', 'Легковой автомобиль Seat Arona', 'Современный компактный кроссовер красно-черного цвета в отличном состоянии. Стильный городской автомобиль с комфортным салоном и элегантным дизайном. Подходит для повседневной езды по городу и загородных поездок.', 1301, 0.9900, '', '{}', 'local_algorithms', 4, NULL, NULL, NULL, false, NULL, NULL, '2025-09-25 10:05:02.599746', '2025-09-25 10:05:02.599746', 'listing');
INSERT INTO public.ai_category_decisions (id, title_hash, title, description, category_id, confidence, reasoning, alternative_category_ids, ai_model, processing_time_ms, ai_domain, ai_product_type, ai_keywords, user_confirmed, user_corrected_category_id, user_feedback_at, created_at, updated_at, entity_type) VALUES (35, '5c9e7479e2c753a35194eae6b439189d3e474a1d6c0ffc628771da81426c31c3', 'SEAT Arona 2019', 'Компактный кроссовер SEAT Arona в отличном состоянии. Автомобиль в красно-коричневом цвете с черной крышей, оснащен стильными легкосплавными дисками. Современный дизайн, просторный салон и высокий клиренс делают его идеальным городским автомобилем.', 1301, 0.9900, '', '{}', 'local_algorithms', 5, NULL, NULL, NULL, false, NULL, NULL, '2025-09-25 11:19:45.264719', '2025-09-25 11:19:45.264719', 'listing');
INSERT INTO public.ai_category_decisions (id, title_hash, title, description, category_id, confidence, reasoning, alternative_category_ids, ai_model, processing_time_ms, ai_domain, ai_product_type, ai_keywords, user_confirmed, user_corrected_category_id, user_feedback_at, created_at, updated_at, entity_type) VALUES (17, '18a8f888865fb0478c80677987f3914a00afbbf8ee3ec6ffd1c2fba8b64dc4fe', 'Volkswagen Touran 2008', 'Volkswagen Touran 2008 года в хорошем состоянии. Серый металлик, панорамная крыша, легкосплавные диски. Автомобиль ухоженный, регулярно обслуживался. Просторный семейный минивэн с вместительным багажником и комфортным салоном.', 1002, 0.9900, '', '{}', 'local_algorithms', 4, NULL, NULL, NULL, false, NULL, NULL, '2025-09-25 07:44:38.741396', '2025-09-25 16:27:57.508299', 'listing');
INSERT INTO public.ai_category_decisions (id, title_hash, title, description, category_id, confidence, reasoning, alternative_category_ids, ai_model, processing_time_ms, ai_domain, ai_product_type, ai_keywords, user_confirmed, user_corrected_category_id, user_feedback_at, created_at, updated_at, entity_type) VALUES (20, 'ed6cd49a526dcea98a821c8d3b3647b95e02d5089576fd81e28c1470eb98f8e4', 'Volkswagen Touran 2009', 'Volkswagen Touran 2009 года выпуска в хорошем состоянии. Серый металлик, компактвэн с просторным салоном. Оснащен рейлингами на крыше, противотуманными фарами и легкосплавными дисками. Автомобиль находится в ухоженном состоянии, регулярно обслуживался.', 1002, 0.9900, '', '{}', 'local_algorithms', 5, NULL, NULL, NULL, false, NULL, NULL, '2025-09-25 08:01:21.758088', '2025-09-25 16:27:57.508299', 'listing');
INSERT INTO public.ai_category_decisions (id, title_hash, title, description, category_id, confidence, reasoning, alternative_category_ids, ai_model, processing_time_ms, ai_domain, ai_product_type, ai_keywords, user_confirmed, user_corrected_category_id, user_feedback_at, created_at, updated_at, entity_type) VALUES (29, '3fd3a68c2ed2216b0f53d0e8f3f5f39f7e620b4e230f011492ec4a032b0a41bb', 'Volkswagen Touran MPV', 'Надежный семейный минивэн Volkswagen Touran в сером цвете. Автомобиль в хорошем состоянии, подходит для повседневного использования и семейных поездок. Компактный, маневренный, с просторным салоном.', 1002, 0.9900, '', '{}', 'local_algorithms', 5, NULL, NULL, NULL, false, NULL, NULL, '2025-09-25 09:20:43.263689', '2025-09-25 16:27:57.508299', 'listing');
INSERT INTO public.ai_category_decisions (id, title_hash, title, description, category_id, confidence, reasoning, alternative_category_ids, ai_model, processing_time_ms, ai_domain, ai_product_type, ai_keywords, user_confirmed, user_corrected_category_id, user_feedback_at, created_at, updated_at, entity_type) VALUES (36, '1c0c371d6d7bfdb723cadc8c990c39af81bec6b54dd90545edeff514a25b410d', 'McLaren 720S', 'Роскошный суперкар McLaren 720S в безупречном серебристом цвете. Автомобиль отличается агрессивным дизайном с характерными воздухозаборниками и аэродинамическими элементами. Оснащен мощным двигателем V8 с двойным турбонаддувом. Элегантный спортивный силуэт подчеркивают стильные колесные диски и карбоновые элементы кузова.', 1301, 0.9500, 'Описание товара ясно указывает, что это роскошный суперкар McLaren 720S, который является личным автомобилем, а не коммерческим или специальным транспортом. Категория ''Lični automobili'' (Личные автомобили) наиболее точно соответствует этому товару.', NULL, 'claude-3-haiku-20240307', 1429, NULL, NULL, NULL, false, NULL, NULL, '2025-09-25 11:26:32.508713', '2025-09-25 11:26:32.508713', 'listing');
INSERT INTO public.ai_category_decisions (id, title_hash, title, description, category_id, confidence, reasoning, alternative_category_ids, ai_model, processing_time_ms, ai_domain, ai_product_type, ai_keywords, user_confirmed, user_corrected_category_id, user_feedback_at, created_at, updated_at, entity_type) VALUES (38, 'f3386259ab1df03b106fa77af9f5cc28010d7826db6498d96aa74deb46da5968', 'SEAT Arona 2020', 'Компактный кроссовер SEAT Arona в отличном состоянии. Автомобиль в красно-бордовом цвете с черной крышей, оснащен современными LED-фарами, легкосплавными дисками, имеет стильный дизайн и высокий клиренс. Характерные черты модели включают рейлинги на крыше и защитные накладки на колесных арках.', 1301, 0.9900, '', '{}', 'local_algorithms', 1, NULL, NULL, NULL, false, NULL, NULL, '2025-09-25 11:35:19.479003', '2025-09-25 11:35:19.479003', 'listing');
INSERT INTO public.ai_category_decisions (id, title_hash, title, description, category_id, confidence, reasoning, alternative_category_ids, ai_model, processing_time_ms, ai_domain, ai_product_type, ai_keywords, user_confirmed, user_corrected_category_id, user_feedback_at, created_at, updated_at, entity_type) VALUES (40, 'c825acadbff267198d725916dd64d66fcf940da55c12999f8038be6012edcb8b', 'Красный компактный внедорожник', 'Современный компактный кроссовер красного цвета в отличном состоянии. Элегантный дизайн, компактные размеры идеально подходят для городской среды. Черные элементы кузова подчеркивают спортивный характер автомобиля. Литые диски придают солидный вид.', 1301, 0.9000, 'Товар описывает современный компактный кроссовер красного цвета, что соответствует категории личных автомобилей. Элегантный дизайн, компактные размеры и спортивные черные элементы кузова характерны для данной категории.', NULL, 'claude-3-haiku-20240307', 1363, NULL, NULL, NULL, false, NULL, NULL, '2025-09-25 12:20:21.646583', '2025-09-25 12:20:21.646583', 'listing');
INSERT INTO public.ai_category_decisions (id, title_hash, title, description, category_id, confidence, reasoning, alternative_category_ids, ai_model, processing_time_ms, ai_domain, ai_product_type, ai_keywords, user_confirmed, user_corrected_category_id, user_feedback_at, created_at, updated_at, entity_type) VALUES (41, 'aff7fe835151f5046fe0b971ce931bce827533cd7d1969ebda1cf7f1897fe8eb', 'Красный автомобиль SEAT Arona', 'Современный компактный кроссовер в отличном состоянии. Яркий красный цвет, элегантный дизайн, подходит для городской езды. Оснащен стильными легкосплавными дисками, имеет компактные габариты и практичный кузов.', 1301, 0.9900, '', '{}', 'local_algorithms', 6, NULL, NULL, NULL, false, NULL, NULL, '2025-09-25 13:00:56.048554', '2025-09-25 13:00:56.048554', 'listing');
INSERT INTO public.ai_category_decisions (id, title_hash, title, description, category_id, confidence, reasoning, alternative_category_ids, ai_model, processing_time_ms, ai_domain, ai_product_type, ai_keywords, user_confirmed, user_corrected_category_id, user_feedback_at, created_at, updated_at, entity_type) VALUES (42, 'c9bcc8517a0513d137224bfded869dc052d240572f301234f6fcb62b8a327047', 'Красный городской внедорожник', 'Современный компактный кроссовер красного цвета в отличном состоянии. Стильный дизайн, аэродинамичные линии, темная крыша контрастирует с основным цветом кузова. Подходит для городской езды и загородных поездок. Литые диски придают автомобилю солидный вид.', 1301, 0.9000, 'Товар представляет собой современный компактный кроссовер, который подходит для городской езды и загородных поездок. Такие автомобили относятся к категории личных (легковых) автомобилей.', NULL, 'claude-3-haiku-20240307', 1164, NULL, NULL, NULL, false, NULL, NULL, '2025-09-25 13:15:10.315197', '2025-09-25 13:15:10.315197', 'listing');
INSERT INTO public.ai_category_decisions (id, title_hash, title, description, category_id, confidence, reasoning, alternative_category_ids, ai_model, processing_time_ms, ai_domain, ai_product_type, ai_keywords, user_confirmed, user_corrected_category_id, user_feedback_at, created_at, updated_at, entity_type) VALUES (47, 'db4b8bd5c035275613084ee07d63e807d92bec3e871bd79969721e20f3cbb66a', 'Smart ForTwo Matte Black', 'Компактный городской автомобиль Smart ForTwo в матовом черном цвете. Автомобиль в хорошем состоянии, оснащен стильными легкосплавными дисками. Кузов покрыт матовой черной пленкой. Идеален для городской парковки и маневрирования в плотном трафике.', 1301, 0.9500, 'Анализируемый товар является компактным городским автомобилем Smart ForTwo, который относится к категории личных автомобилей. Описание товара четко указывает на его назначение и характеристики, подходящие под данную категорию.', NULL, 'claude-3-haiku-20240307', 1256, NULL, NULL, NULL, false, NULL, NULL, '2025-09-25 15:02:10.568384', '2025-09-25 15:02:10.568384', 'listing');
INSERT INTO public.ai_category_decisions (id, title_hash, title, description, category_id, confidence, reasoning, alternative_category_ids, ai_model, processing_time_ms, ai_domain, ai_product_type, ai_keywords, user_confirmed, user_corrected_category_id, user_feedback_at, created_at, updated_at, entity_type) VALUES (48, '15602948fbdc8f9e97b864c83378024f530fa36c01dd5efd491d4584ddd2bcb5', 'Серый седан Mazda', 'Новый, элегантный седан в сером цвете металлик. Идеальное состояние, современный дизайн, премиальные линии кузова. Подходит для городской езды и комфортных поездок. Стильные легкосплавные диски, затемненные стекла, аэродинамический силуэт.', 1301, 0.9900, '', '{}', 'local_algorithms', 3, NULL, NULL, NULL, false, NULL, NULL, '2025-09-25 15:08:21.279821', '2025-09-25 15:08:21.279821', 'listing');
INSERT INTO public.ai_category_decisions (id, title_hash, title, description, category_id, confidence, reasoning, alternative_category_ids, ai_model, processing_time_ms, ai_domain, ai_product_type, ai_keywords, user_confirmed, user_corrected_category_id, user_feedback_at, created_at, updated_at, entity_type) VALUES (49, '695c30a2128ce2efe743bb42cc47bd0366b8ac5b42da918aca7c18fdce7cf113', 'Синий седан Mazda', 'Современный стильный седан темно-синего цвета в отличном состоянии. Элегантный дизайн, блестящий кузов, спортивный силуэт. Колеса с легкосплавными дисками, тонированные стекла. Идеальный вариант для делового человека или семьи, ценящей комфорт и статус.', 1301, 0.9900, '', '{}', 'local_algorithms', 4, NULL, NULL, NULL, false, NULL, NULL, '2025-09-25 15:16:50.744575', '2025-09-25 15:16:50.744575', 'listing');
INSERT INTO public.ai_category_decisions (id, title_hash, title, description, category_id, confidence, reasoning, alternative_category_ids, ai_model, processing_time_ms, ai_domain, ai_product_type, ai_keywords, user_confirmed, user_corrected_category_id, user_feedback_at, created_at, updated_at, entity_type) VALUES (50, '9df4c990745ec5bbe8ada55cb232f028c387567d97296f895181e8f39dfc13d0', 'Ford S-Max серебристый', 'Ford S-Max в хорошем состоянии, серебристого цвета с тонированными стеклами. Автомобиль оснащен литыми дисками темного цвета, имеет характерный спортивный дизайн минивэна. Кузов без видимых повреждений, все двери и окна в рабочем состоянии.', 1301, 0.9900, '', '{}', 'local_algorithms', 5, NULL, NULL, NULL, false, NULL, NULL, '2025-09-25 16:16:34.308136', '2025-09-25 16:16:34.308136', 'listing');
INSERT INTO public.ai_category_decisions (id, title_hash, title, description, category_id, confidence, reasoning, alternative_category_ids, ai_model, processing_time_ms, ai_domain, ai_product_type, ai_keywords, user_confirmed, user_corrected_category_id, user_feedback_at, created_at, updated_at, entity_type) VALUES (51, '7d5a46f21d5bc73b579ab502ea0495ee190c07816c414fbd9703c3511af7271a', 'SEAT Arona SUV', 'SEAT Arona compact SUV in excellent condition. Features a striking red metallic paint, black roof, alloy wheels, and modern LED headlights. This crossover combines urban practicality with stylish design. Well-maintained exterior with no visible damage.', 1301, 0.9900, '', '{}', 'local_algorithms', 3, NULL, NULL, NULL, false, NULL, NULL, '2025-09-25 16:19:27.29135', '2025-09-25 16:19:27.29135', 'listing');
INSERT INTO public.ai_category_decisions (id, title_hash, title, description, category_id, confidence, reasoning, alternative_category_ids, ai_model, processing_time_ms, ai_domain, ai_product_type, ai_keywords, user_confirmed, user_corrected_category_id, user_feedback_at, created_at, updated_at, entity_type) VALUES (54, '49d0e16006521b06bc45c61c67fafec24ed4cfda6927fb057d870e2c9bdccb95', 'Mazda 3 Седан', 'Современный седан Mazda 3 в отличном состоянии. Автомобиль имеет стильный серый металлик цвет кузова, элегантный дизайн с характерными для бренда плавными линиями. Оснащен легкосплавными дисками, имеет аэродинамичный профиль и характерную решетку радиатора. Видны хромированные элементы отделки и тонированные стекла.', 1301, 0.9500, 'Основываясь на названии и описании товара, это явно личный автомобиль, а именно седан Mazda 3. Он подходит под категорию ''Lični automobili'' (Личные автомобили).', NULL, 'claude-3-haiku-20240307', 1312, NULL, NULL, NULL, false, NULL, NULL, '2025-09-26 16:04:28.783604', '2025-09-26 16:04:28.783604', 'listing');
