INSERT INTO public.ai_category_decisions (id, title_hash, title, description, category_id, confidence, reasoning, alternative_category_ids, ai_model, processing_time_ms, ai_domain, ai_product_type, ai_keywords, user_confirmed, user_corrected_category_id, user_feedback_at, created_at, updated_at, entity_type) VALUES (56, '575fd98d52ed4673eae6d4d78b35b650714a3dd0589cb5a91a2397537ae9fb75', 'Ford S-Max', 'Silver Ford S-Max in used condition. Features custom dark alloy wheels, tinted windows, and appears to be well-maintained. The vehicle has a sporty appearance with its distinctive MPV body style. Parked in an urban residential area.', 1301, 0.9500, 'Описание товара явно указывает на подержанный легковой автомобиль Ford S-Max, который относится к категории личных автомобилей. Кроме того, упоминаются дополнительные характеристики, такие как тонированные окна и спортивный внешний вид, что делает эту категорию наиболее подходящей.', NULL, 'claude-3-haiku-20240307', 1493, NULL, NULL, NULL, false, NULL, NULL, '2025-09-26 17:34:40.035786', '2025-09-26 17:34:40.035786', 'listing');
